DROP TABLE IF EXISTS `SYS_USER`;
CREATE TABLE `SYS_USER` (
  `USER_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `USER_NAME` varchar(50) DEFAULT NULL COMMENT '用户名',
  `USER_PASSWORD` varchar(50) DEFAULT NULL COMMENT '密码',
  `USER_CODE` char(10) DEFAULT NULL COMMENT '用户编号',
  `TRUE_NAME` varchar(100) DEFAULT NULL COMMENT '真实姓名',
  `USER_PHONE` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `USER_EMAIL` varchar(50) DEFAULT NULL COMMENT 'E-MAIL',
  `STATUS` char(1) DEFAULT '0' COMMENT '状态:0首次注册;1正常登录;2禁止登录,3停用,4删除',
  `IS_MANAGE` char(1) DEFAULT '0' COMMENT '是否管理员0:普通用户；1:管理员；',
  `ADD_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `WX_ID` varchar(50) DEFAULT NULL COMMENT '微信号',
  `DEPART_ID` int(11) DEFAULT NULL COMMENT '部门ID',
  `ROLE_ID` int(11) DEFAULT NULL COMMENT '角色ID',
  `USER_TYPE` char(1) DEFAULT NULL COMMENT '用户类型:1普通用户,2专家',
  `LAST_LOGIN_TIME` datetime DEFAULT NULL COMMENT '最后登录时间',
  `PHONE` varchar(50) DEFAULT NULL COMMENT '固定电话',
  `OPENID` varchar(50) DEFAULT NULL,
  `SHOW_NAME` varchar(100) DEFAULT NULL,
  `WX_REMIND` char(1) DEFAULT NULL,
  `SMS_REMIND` char(1) DEFAULT NULL,
  `EMAIL_REMIND` char(1) DEFAULT NULL,
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=297 DEFAULT CHARSET=utf8 COMMENT='用户表';

